import React, { useEffect, useState } from "react";
import { motion } from "framer-motion";
import gsap from "gsap";
import Footer from "../components/Footer";
import emailjs from "emailjs-com";
import Spinner from "../components/UI/Spinner/Spinner";

const transition = { duration: 1, ease: "easeInOut", delay: 0.8 };

const initialForm = {
  name: "",
  email: "",
  message: "",
};

const Contact = () => {
  const [formState, setFormState] = useState(initialForm);
  const [buttonMessage, setButtonMessage] = useState("Send Message.");
  const [loading, setLoading] = useState(false);

  const { name, email, message } = formState;
  useEffect(() => {
    window.scrollTo({
      top: 0,
      left: 0,
    });
    document.title = "Alex — Contact Me";

    gsap.from(".services__inner", {
      duration: 0.2,
      delay: 1,
      opacity: 0,
      ease: "Power4.out",
    });
    gsap.to(".cursor", {
      duration: 0,
      css: { display: "none" },
    });
  }, []);

  const onChange = (e) => {
    const { name, value } = e.target;

    setFormState({ ...formState, [name]: value });
  };

  const onSubmit = async (e) => {
    e.preventDefault();

    const service_id = "service_p7ar3ih";
    const template_id = "template_va7p0gm";
    const userId = "Fu3omPvgJbH9IYW4W";
    try {
      setLoading(true);
      await emailjs.send(service_id, template_id, formState, userId);
      setFormState(initialForm);
      setLoading(false);
      setButtonMessage("Success!!");
    } catch (err) {
      setLoading(false);
      setButtonMessage("Error, Try again.");
    }
  };
  return (
    <>
      <motion.div initial={{ height: "100vh" }} className="transition" />
      <motion.div
        exit={{ height: "100vh", transition }}
        className="transition2"
      />
      <motion.div
        initial={{ height: 0, visibility: "hidden" }}
        animate={{
          height: "100%",
          visibility: "visible",
          transition: { ...transition, duration: 2, delay: -0.2 },
        }}
        className="services"
      >
        <div className="services__inner">
          <div className="services__top">
            <div className="title">Get In Touch!</div>
            <div className="sub">
              Got a question, proposal or project or want to work <br />{" "}
              together on something? Feel free to reach out.
            </div>
            <form onSubmit={onSubmit}>
              <div className="input-row">
                <div className="side">
                  <label htmlFor="name">Your Name</label>
                  <input
                    placeholder="What's Your Name?"
                    name="name"
                    id="name"
                    type="text"
                    required
                    value={name}
                    onChange={onChange}
                  />
                </div>

                <div className="side">
                  <label htmlFor="email">Your Email</label>
                  <input
                    placeholder="What's Your Email?"
                    name="email"
                    id="email"
                    type="email"
                    required
                    value={email}
                    onChange={onChange}
                  />
                </div>
              </div>
              <div className="textarea">
                <label htmlFor="message">Your Message</label>
                <textarea
                  name="message"
                  id="message"
                  placeholder="Hello, I think we need you to work on/collaborate this particular product... Reach out as soon as you can."
                  required
                  value={message}
                  onChange={onChange}
                ></textarea>
              </div>
              <button type="submit">
                {loading ? <Spinner /> : buttonMessage}
              </button>
            </form>
          </div>
          <Footer />
        </div>
      </motion.div>
    </>
  );
};

export default Contact;
